import React, { useState } from "react";
import "./App.css";

function App() {
  const [darkMode, setDarkMode] = useState(true);
  const [count, setCount] = useState(523);
  const [goal, setGoal] = useState(1000);
  const [font, setFont] = useState("Poppins");
  const [color, setColor] = useState("#00ffaa");
  const [showBox, setShowBox] = useState(true);
  const [showGoal, setShowGoal] = useState(true);

  const percentage = Math.min((count / goal) * 100, 100);

  const toggleMode = () => setDarkMode(!darkMode);

  return (
    <div className={`page ${darkMode ? "dark" : "light"}`}>
      {/* === Header === */}
      <div className="topbar">
        <div className="brand">HIGHCOUNT</div>
        <button onClick={toggleMode} className="mode-toggle">
          {darkMode ? "Light Mode" : "Dark Mode"}
        </button>
      </div>

      {/* === Config Panel === */}
      <div className="panel glass">
        <div className="row">
          <label>Followers:</label>
          <input
            type="number"
            className="inp"
            value={count}
            onChange={(e) => setCount(parseInt(e.target.value || 0))}
          />
        </div>

        <div className="row">
          <label>Goal:</label>
          <input
            type="number"
            className="inp"
            value={goal}
            onChange={(e) => setGoal(parseInt(e.target.value || 0))}
          />
        </div>

        <div className="row">
          <label>Font:</label>
          <select
            className="select"
            value={font}
            onChange={(e) => setFont(e.target.value)}
          >
            <option value="Poppins">Poppins</option>
            <option value="Montserrat">Montserrat</option>
            <option value="Roboto">Roboto</option>
            <option value="Orbitron">Orbitron</option>
            <option value="Bebas Neue">Bebas Neue</option>
          </select>
          <div className="font-preview" style={{ fontFamily: font }}>
            Preview text 12345
          </div>
        </div>

        <div className="row">
          <label>Color:</label>
          <input
            type="color"
            className="hex"
            value={color}
            onChange={(e) => setColor(e.target.value)}
          />
        </div>

        <div className="row">
          <label>Show Follower Box:</label>
          <input
            type="checkbox"
            checked={showBox}
            onChange={(e) => setShowBox(e.target.checked)}
          />
        </div>

        <div className="row">
          <label>Show Goal:</label>
          <input
            type="checkbox"
            checked={showGoal}
            onChange={(e) => setShowGoal(e.target.checked)}
          />
        </div>
      </div>

      {/* === Preview === */}
      <div className="preview-title">Live Preview</div>
      <div className={`overlay-box ${showBox ? "with-box" : ""}`}>
        <div
          className="overlay-count"
          style={{ color, fontFamily: font }}
        >
          {count}
        </div>
      </div>

      {showGoal && (
        <div className="goal-container">
          <div className="goal-text">
            {count} / {goal} followers
          </div>
          <div className="goal-bar">
            <div
              className="goal-fill"
              style={{
                width: `${percentage}%`,
                background: color,
              }}
            ></div>
          </div>
        </div>
      )}

      {/* === Footer === */}
      <footer className="credit">
        made by{" "}
        <a
          href="https://kick.com/highman-edits"
          target="_blank"
          rel="noreferrer"
          className="author"
        >
          highman_edits
        </a>{" "}
        with <img
          className="emote"
          src="https://cdn.7tv.app/emote/01GR4G94K00003C5VKDM5EYK9S/4x.avif"
          alt="ðŸ’š"
        />{" "}
        <span className="note">not affiliated with Kick</span>
      </footer>
    </div>
  );
}

export default App;
